export function getKaggleHistoryForAsset(assetTag: string): KaggleTransformerRecord[] {
  return KAGGLE_TRANSFORMER_DATA.filter(r => r.assetTag === assetTag).sort(
    (a, b) => new Date(a.timestamp).getTime() - new Date(b.timestamp).getTime()
  )
}

export function getKaggleLatestReading(assetTag: string): KaggleTransformerRecord | null {
  const records = getKaggleHistoryForAsset(assetTag)
  return records.length > 0 ? records[records.length - 1] : null
}

